		function format(b) {
			var string = "";
			if (b.sign == 0) {
				string += "-";
			}
			if (b.shift < 6) {
				for (var i = 0 ; i < b.shift ; ++i) {
					string += "e";
				}
			}
			else {
				string += "(" + b.shift + "e)";
			}
			if (b.power < 10) {
				var num = b.num * Math.pow(10, b.power);
				string += Math.round(num*100000)/100000;
			}
			else {
				string += Math.round(b.num*100000)/100000;
				string += "e";
				string += Math.round(b.power);
			}
			return string;
		}
		
